	(199, 'H', 'A', '射出曲线测试', '射出曲线--无实际曲线时,当射出设定压力/速度>保压时，曲线纵坐标最大值应抓取射出设定最大值，小数位数值应完整显示，观察保压画线是否正常；', 'FQC', 0, 45, NULL),
	(200, 'H', 'A', '射出曲线测试', '射出曲线--有实际曲线时，曲线纵坐标最大值应抓取实际动作和设定值中的最大值；', 'FQC', 0, 45, NULL),
	(201, 'H', 'A', '射出曲线测试', '断电重启后，射出曲线应被清除；', 'FQC', 0, 45, NULL),
	(202, 'H', 'A', '屏保功能', '屏保功能--由时间启动是否正常；', 'FQC', 0, 46, NULL),
	(203, 'H', 'A', '屏保功能', '屏保功能--由开模次数启动是否正常；', 'FQC', 0, 46, NULL),
	(204, 'H', 'A', '屏保功能', '屏保启动后，能否正常唤醒面板；', 'FQC', 0, 46, NULL),
	(205, 'H', 'A', '计数画面测试', '包装总数归零，仅"现在包装总数"归零；', 'FQC', 0, 47, NULL),
	(206, 'H', 'A', '计数画面测试', '开模总数归零，"现在包装总数"&"现在产品总数"均归零；', 'FQC', 0, 47, NULL),
	(207, 'H', 'A', '计数画面测试', '当"现在包装总数"等于"目标包装总数"时，系统警报“开模装数已到”，托模完成后，机台不停止，继续进行下一循环，"现在包装总数"自动归零；', 'FQC', 0, 47, NULL),
	(208, 'H', 'A', '计数画面测试', '当"现在产品总数"等于"目标产品总数"时，系统警报"开模数已到"，托模完成后，机台停止动作，无法自动进行下一循环；', 'FQC', 0, 47, NULL),
	(209, 'H', 'A', '系统压力测试', '组态画面，系统压力上限=0时，系统压力抓取140；', 'FQC', 0, 48, NULL),
	(210, 'H', 'A', '系统压力测试', '组态画面，系统压力上限=1时，系统压力抓取主机@0600值；', 'FQC', 0, 48, NULL),
	(211, 'H', 'A', '系统压力测试', '组态画面，系统压力上限>1时，系统压力抓取实际设定值；', 'FQC', 0, 48, NULL),
	(212, 'H', 'A', '系统压力测试', '若程序为伺服（AUSTONE、HYB2/3等），则系统压力上限不可编辑；', 'FQC', 0, 48, NULL),
	(213, 'H', 'A', '监测功能测试', '自动循环后，检查监测画面传值是否正确；', 'FQC', 0, 49, NULL),
	(214, 'H', 'A', '监测功能测试', '查看监测资料是否记录正常，是否有跳模现象，是否可被重置；', 'FQC', 0, 49, NULL),
	(215, 'H', 'A', '监测功能测试', '设定监测误差%和误差量，查看上下限计算是否正确；', 'FQC', 0, 49, NULL),
	(216, 'H', 'A', '监测功能测试', '参数画面--"自动警报启动模数"改为0，测一画面的自动监测自动变为"不用"；', 'FQC', 0, 49, NULL),
	(217, 'H', 'A', '按键测试', '依序按下开模、关模......等手动按键，检查状态栏是否显示相应动作字串、图标，并检查LED灯是否正常开启/关闭；', 'FQC', 0, 50, NULL),
	(218, 'H', 'A', '按键测试', '依序按下手动、半自动、电眼自动、全自动、粗调模等按键，检查状态栏是否显示相应字串、图标，并检查LED灯是否正常开启/关闭；', 'FQC', 0, 50, NULL),
	(219, 'H', 'A', '按键测试', '按下两次粗调模，观察是否进入自动调模,并且LED灯一闪一闪；（立式机无此功能）', 'FQC', 0, 50, NULL),
	(220, 'H', 'A', '按键测试', '检查吹气/中子按键复用是否正确；', 'FQC', 0, 50, NULL),
	(221, 'H', 'A', '动作测试', '手动下，检查动作输出压力速度是否正确，各段间转换是否正确；', 'FQC', 0, 51, NULL),
	(222, 'H', 'A', '动作测试', '半自动、电眼自动、全自动下跑动作，观察动作是否正常，压力速度输出是否正确；', 'FQC', 0, 51, NULL),
	(223, 'H', 'A', '动作测试', '粗调模下，按下各动作按键，观察是否输出装模压力速度；', 'FQC', 0, 51, NULL),
	(224, 'H', 'A', '动作测试', '开关模、射出保压和储料动作时，当前段会高亮显示；', 'FQC', 0, 51, NULL),
	(225, 'H', 'A', '标准化测试', '自动/半自动时，无法进入参数画面，提示字串需更新为“请在手动/粗调模状态执行”；', 'FQC', 0, 52, NULL),
	(226, 'H', 'A', '标准化测试', '温度PID在任何状态下都可输入密码进入；', 'FQC', 0, 52, NULL),
	(227, 'H', 'A', '英制单位测试', '英制单位转换后，检查单位字串是否全部改变；', 'FQC', 0, 53, NULL),
	(228, 'H', 'A', '英制单位测试', '英制单位转换后，检查数值是否全部改变；', 'FQC', 0, 53, NULL),
	(229, 'H', 'A', '英制单位测试', '英制单位转换后，检查位置是否全部变为2位精度；', 'FQC', 0, 53, NULL),
	(230, 'H', 'A', '英制单位测试', '英制单位时，解停机功能，观察画面是否正常；', 'FQC', 0, 53, NULL);
